pub enum UnitSectionOffset<T = usize> {
    DebugInfoOffset(DebugInfoOffset<T>),
    DebugTypesOffset(DebugTypesOffset<T>),
}

pub enum CieOrFde<'bases, Section, R> where R: Reader,
    Section: UnwindSection<R> {
    Cie(CommonInformationEntry<R>),
    Fde(PartialFrameDescriptionEntry),
}

pub enum CfaRule<R: Reader> {
    RegisterAndOffset {
            register: Register,
            offset: i64,
        },
    Expression(Expression<R>),
}

pub enum CallFrameInstruction<R: Reader> {
    SetLoc {
            address: u64,
        },
    AdvanceLoc {
            delta: u32,
        },
    DefCfa {
            register: Register,
            offset: u64,
        },
    DefCfaSf {
            register: Register,
            factored_offset: i64,
        },
    DefCfaRegister {
            register: Register,
        },
    DefCfaOffset {
            offset: u64,
        },
    DefCfaOffsetSf {
            factored_offset: i64,
        },
    DefCfaExpression {
            expression: Expression<R>,
        },
    Undefined {
            register: Register,
        },
    SameValue {
            register: Register,
        },
    Offset {
            register: Register,
            factored_offset: u64,
        },
    OffsetExtendedSf {
            register: Register,
            factored_offset: i64,
        },
    ValOffset {
            register: Register,
            factored_offset: u64,
        },
    ValOffsetSf {
            register: Register,
            factored_offset: i64,
        },
    Register {
            dest_register: Register,
            src_register: Register,
        },
    Expression {
            register: Register,
            expression: Expression<R>,
        },
    ValExpression {
            register: Register,
            expression: Expression<R>,
        },
    Restore {
            register: Register,
        },
    RememberState,
    RestoreState,
    ArgsSize {
            size: u64,
        },
    Nop,
}

pub enum RawLocListEntry<R: Reader> {
    AddressOrOffsetPair {
            begin: u64,
            end: u64,
            data: Expression<R>,
        },
    BaseAddress {
            addr: u64,
        },
    BaseAddressx {
            addr: DebugAddrIndex<R::Offset>,
        },
    StartxEndx {
            begin: DebugAddrIndex<R::Offset>,
            end: DebugAddrIndex<R::Offset>,
            data: Expression<R>,
        },
    StartxLength {
            begin: DebugAddrIndex<R::Offset>,
            length: u64,
            data: Expression<R>,
        },
    OffsetPair {
            begin: u64,
            end: u64,
            data: Expression<R>,
        },
    DefaultLocation {
            data: Expression<R>,
        },
    StartEnd {
            begin: u64,
            end: u64,
            data: Expression<R>,
        },
    StartLength {
            begin: u64,
            length: u64,
            data: Expression<R>,
        },
}

pub enum DieReference<T = usize> {
    UnitRef(UnitOffset<T>),
    DebugInfoRef(DebugInfoOffset<T>),
}

pub enum Operation<R, Offset = <R as Reader>::Offset> where R: Reader<Offset =
    Offset>, Offset: ReaderOffset {
    Deref {
            base_type: UnitOffset<Offset>,
            size: u8,
            space: bool,
        },
    Drop,
    Pick {
            index: u8,
        },
    Swap,
    Rot,
    Abs,
    And,
    Div,
    Minus,
    Mod,
    Mul,
    Neg,
    Not,
    Or,
    Plus,
    PlusConstant {
            value: u64,
        },
    Shl,
    Shr,
    Shra,
    Xor,
    Bra {
            target: i16,
        },
    Eq,
    Ge,
    Gt,
    Le,
    Lt,
    Ne,
    Skip {
            target: i16,
        },
    UnsignedConstant {
            value: u64,
        },
    SignedConstant {
            value: i64,
        },
    Register {
            register: Register,
        },
    RegisterOffset {
            register: Register,
            offset: i64,
            base_type: UnitOffset<Offset>,
        },
    FrameOffset {
            offset: i64,
        },
    Nop,
    PushObjectAddress,
    Call {
            offset: DieReference<Offset>,
        },
    TLS,
    CallFrameCFA,
    Piece {
            size_in_bits: u64,
            bit_offset: Option<u64>,
        },
    ImplicitValue {
            data: R,
        },
    StackValue,
    ImplicitPointer {
            value: DebugInfoOffset<Offset>,
            byte_offset: i64,
        },
    EntryValue {
            expression: R,
        },
    ParameterRef {
            offset: UnitOffset<Offset>,
        },
    Address {
            address: u64,
        },
    AddressIndex {
            index: DebugAddrIndex<Offset>,
        },
    ConstantIndex {
            index: DebugAddrIndex<Offset>,
        },
    TypedLiteral {
            base_type: UnitOffset<Offset>,
            value: R,
        },
    Convert {
            base_type: UnitOffset<Offset>,
        },
    Reinterpret {
            base_type: UnitOffset<Offset>,
        },
    WasmLocal {
            index: u32,
        },
    WasmGlobal {
            index: u32,
        },
    WasmStack {
            index: u32,
        },
}

pub enum Location<R, Offset = <R as Reader>::Offset> where R: Reader<Offset =
    Offset>, Offset: ReaderOffset {
    Empty,
    Register {
            register: Register,
        },
    Address {
            address: u64,
        },
    Value {
            value: Value,
        },
    Bytes {
            value: R,
        },
    ImplicitPointer {
            value: DebugInfoOffset<Offset>,
            byte_offset: i64,
        },
}

pub enum EvaluationResult<R: Reader> {
    Complete,
    RequiresMemory {
            address: u64,
            size: u8,
            space: Option<u64>,
            base_type: UnitOffset<R::Offset>,
        },
    RequiresRegister {
            register: Register,
            base_type: UnitOffset<R::Offset>,
        },
    RequiresFrameBase,
    RequiresTls(u64),
    RequiresCallFrameCfa,
    RequiresAtLocation(DieReference<R::Offset>),
    RequiresEntryValue(Expression<R>),
    RequiresParameterRef(UnitOffset<R::Offset>),
    RequiresRelocatedAddress(u64),
    RequiresIndexedAddress {
            index: DebugAddrIndex<R::Offset>,
            relocate: bool,
        },
    RequiresBaseType(UnitOffset<R::Offset>),
}

pub enum RawRngListEntry<T> {
    AddressOrOffsetPair {
            begin: u64,
            end: u64,
        },
    BaseAddress {
            addr: u64,
        },
    BaseAddressx {
            addr: DebugAddrIndex<T>,
        },
    StartxEndx {
            begin: DebugAddrIndex<T>,
            end: DebugAddrIndex<T>,
        },
    StartxLength {
            begin: DebugAddrIndex<T>,
            length: u64,
        },
    OffsetPair {
            begin: u64,
            end: u64,
        },
    StartEnd {
            begin: u64,
            end: u64,
        },
    StartLength {
            begin: u64,
            length: u64,
        },
}

pub enum UnitType<Offset> where Offset: ReaderOffset {
    Compilation,
    Type {
            type_signature: DebugTypeSignature,
            type_offset: UnitOffset<Offset>,
        },
    Partial,
    Skeleton(DwoId),
    SplitCompilation(DwoId),
    SplitType {
            type_signature: DebugTypeSignature,
            type_offset: UnitOffset<Offset>,
        },
}
